Uma Visão Semântica Global é um conceito genérico para representação de um Grafo Semântico. Uma Visão Semântica Global G é constituída por uma Tripla = {OD, V, L}.

Onde:

  - OD = Ontologia de Domínio;
  - Vg  = Visão Semântica Global;
  - L = Visão de Linksets.
